import React from "react";

const About = () => {
  return (
    <div className="about">
      <div className="intro">
        <h3>Introdutcion</h3>
        <p>
          Schnell lernender Webentwickler, der sich leidenschaftlich für
          sauberen Code und die Lösung schwieriger Probleme interessiert. Immer
          auf dem neuesten Stand über neue Technologien und ein Auge für moderne
          und klare Designs.
        </p>
      </div>
    </div>
  );
};

export default About;
